import React from 'react';
import subscribe from '../../subscribe-img.png';

class Subscribe extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container py-5'>
					<div className='row'>
						<div className='col-10 mx-auto text-left text-slanted my-5'>
							<img src={subscribe} alt='banner'></img>
						</div>
					</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Subscribe;
